import * as React from 'react';

import { Grid } from '@material-ui/core';
import { StylesProvider } from '@material-ui/styles';

const App = () => {
  return (
    <Grid className="App">
      <StylesProvider injectFirst>
      <Grid item>
        Select
      </Grid>
      <Grid container direction='row'>
        <Grid item xs={4}>
          Value 1
        </Grid>
        <Grid item xs={4}>
          Value 2
        </Grid>
        <Grid item xs={4}>
          Value 3
        </Grid>
      </Grid>
      <Grid item>
        Graph
      </Grid>
      </StylesProvider>
    </Grid>
  );
}

export default App;
